package main

import "fmt"

func FindStartPacket(s string) int {
	for i := 0; i < len(s)-3; i++ {
		substr := s[i : i+4]
		set := map[string]bool{}
		for i2 := range substr {
			set[substr[i2:i2+1]] = true
		}

		if len(set) == 4 {
			return i + 4
		}
	}

	return -1
}

func main() {
	inputString := ""
	fmt.Println(FindStartPacket(inputString))
}
